import React from "react";
import { useAuth } from "../context/AuthContext";

const AdminDebug = () => {
  const { user, isAuthenticated, loading } = useAuth();

  return (
    <div className="p-6 bg-white rounded-lg shadow-lg m-4">
      <h2 className="text-2xl font-bold mb-4 text-gray-800">
        Admin Debug Info
      </h2>

      <div className="space-y-3 text-sm">
        <div>
          <strong>Loading:</strong> {loading ? "Yes" : "No"}
        </div>

        <div>
          <strong>Is Authenticated:</strong> {isAuthenticated ? "Yes" : "No"}
        </div>

        <div>
          <strong>User Object:</strong>
          <pre className="bg-gray-100 p-3 rounded mt-2 text-xs overflow-auto">
            {JSON.stringify(user, null, 2)}
          </pre>
        </div>

        <div>
          <strong>User Role:</strong> {user?.role || "Not set"}
        </div>

        <div>
          <strong>Is Staff:</strong> {user?.is_staff ? "Yes" : "No"}
        </div>

        <div>
          <strong>Is Superuser:</strong> {user?.is_superuser ? "Yes" : "No"}
        </div>

        <div>
          <strong>Tokens in localStorage:</strong>
          <ul className="list-disc list-inside mt-2">
            <li>
              Access Token:{" "}
              {localStorage.getItem("access_token") ? "Present" : "Missing"}
            </li>
            <li>
              Refresh Token:{" "}
              {localStorage.getItem("refresh_token") ? "Present" : "Missing"}
            </li>
          </ul>
        </div>

        <div>
          <strong>Current URL:</strong> {window.location.href}
        </div>
      </div>
    </div>
  );
};

export default AdminDebug;
